    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    outlines Refuge accomplishments from January through April of 1944. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. The public relations section of the
    report describes Refuge visitors, Refuge participation, and fishing. N-R forms and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
